import Main from './Main';

function App() {



  return (
    <div className="App">
      <header className="header" style={{backgroundColor: "gray"}}>
          <NavBar 
          logo={'https://i.hizliresim.com/fcgbduc.png'} 
          showSideNav={false} 
          logoStyles={{  height:"0px", width:"0px"}} 
          navBarStyles={{float: "middle"}} 
          linkStyles={{color:"blue", fontWeight:"bold",}}>

              <a className="navbarheader" href="/" ><img src='https://i.hizliresim.com/fcgbduc.png' style={{height:"70px", width:"100px"}}></img></a>
              <a className="navbarheader" href="/yemek">Yemekler</a>
