              <a className="navbarheader" href="/icecek">İçecekler</a>
              <a className="navbarheader" href="/icecek"></a>
              <a className="navbarheader" href="/icecek"></a>

          </NavBar>
      </header>
      <Main />
    </div>
  );
}

export default App;
